import Keys from "./Keys";
import { useEffect } from "react";
import * as Tone from 'tone'
function SynthImage(params) {
  useEffect(() => {
    const trigger = () => {
        const synth = new Tone.Synth().toDestination();
        synth.triggerAttackRelease("C4", "8n")
    }

    trigger();
  }, [])
    return  (
        <div>
         <Keys />
        </div>
      );

}

